import React from 'react'
import { useState } from 'react'
const Navbar = () => {
    const [open, setOpen] = useState(false)

    return (
        <nav data-aos="fade-up" className="navbar">
            <div className="nav-links">
                <a href="#">About me</a>
                <a href="#">Projects</a>
                <a href="#">Skills</a>
                <a href="#">Contact me</a>
                <a href="#">Timeline</a> 
            </div>    
        </nav>
    )
}

export default Navbar;
